        be90d2640470e975e3402d19ba2c66cf\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":1},\"text\":\"Abstract.\
        \ Recent advances in document image analysis (DIA) have been primarily driven\
        \ by the application of neural networks. Ideally, research outcomes could\
        \ be easily deployed in production and extended for further investigation.\
        \ However, various factors like loosely organized codebases and sophisticated\
        \ model con\uFB01gurations complicate the easy reuse of im- portant innovations\
        \ by a wide audience. Though there have been on-going e\uFB00orts to improve\
        \ reusability and simplify deep learning (DL) model development in disciplines\
        \ like natural language processing and computer vision, none of them are optimized\
        \ for challenges in the domain of DIA. This represents a major gap in the\
        \ existing toolkit, as DIA is central to academic research across a wide range\
        \ of disciplines in the social sciences and humanities. This paper introduces\
        \ LayoutParser, an open-source library for streamlining the usage of DL in\
        \ DIA research and applica- tions. The core LayoutParser library comes with\
        \ a set of simple and intuitive interfaces for applying and customizing DL\
        \ models for layout de- tection, character recognition, and many other document\
        \ processing tasks. To promote extensibility, LayoutParser also incorporates\
        \ a community platform for sharing both pre-trained models and full document\
        \ digiti- zation pipelines. We demonstrate that LayoutParser is helpful for\
        \ both lightweight and large-scale digitization pipelines in real-word use\
        \ cases. The library is publicly available at https://layout-parser.github.io.\"\
        },{\"type\":\"UncategorizedText\",\"element_id\":\"12529cdcfd90d0bf95ff502804e61a16\"\
        ,\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\",\"filetype\"\
        :\"application/pdf\",\"page_number\":1},\"text\":\"2 v 8 4 3 5 1 . 3 0 1 2\
        \ : v i X r a\"},{\"type\":\"NarrativeText\",\"element_id\":\"e66a3d2b6c9a872c53e226d8e0cc0a0e\"\
        ,\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\",\"filetype\"\
        :\"application/pdf\",\"page_number\":1},\"text\":\"Keywords: Document Image\
        \ Analysis \xB7 Deep Learning \xB7 Layout Analysis \xB7 Character Recognition\
        \ \xB7 Open Source library \xB7 Toolkit.\"},{\"type\":\"Title\",\"element_id\"\
        :\"3fa53fc0dab8ef96d05d8fd4c7e41b49\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":1},\"text\":\"Introduction\"\
        },{\"type\":\"UncategorizedText\",\"element_id\":\"4355a46b19d348dc2f57c046f8ef63d4\"\
        ,\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\",\"filetype\"\
        :\"application/pdf\",\"page_number\":1},\"text\":\"1\"},{\"type\":\"NarrativeText\"\
        ,\"element_id\":\"bca638b88125eed8a8003e46a6055618\",\"metadata\":{\"filename\"\
        :\"layout-parser-paper-fast.pdf\",\"filetype\":\"application/pdf\",\"page_number\"\
        :1},\"text\":\"Deep Learning(DL)-based approaches are the state-of-the-art\
        \ for a wide range of document image analysis (DIA) tasks including document\
        \ image classi\uFB01cation [11,\"},{\"type\":\"UncategorizedText\",\"element_id\"\
        :\"53c234e5e8472b6ac51c1ae1cab3fe06\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":2},\"text\":\"2\"},{\"type\"\
        :\"Title\",\"element_id\":\"22364b7a1d2b35282b360d61ae08e2b9\",\"metadata\"\
        :{\"filename\":\"layout-parser-paper-fast.pdf\",\"filetype\":\"application/pdf\"\
        ,\"page_number\":2},\"text\":\"Z. Shen et al.\"},{\"type\":\"NarrativeText\"\
        ,\"element_id\":\"82d5520be5fd847464727f56151d316c\",\"metadata\":{\"filename\"\
        :\"layout-parser-paper-fast.pdf\",\"filetype\":\"application/pdf\",\"page_number\"\
        :2},\"text\":\"37], layout detection [38, 22], table detection [26], and scene\
        \ text detection [4]. A generalized learning-based framework dramatically\
        \ reduces the need for the manual speci\uFB01cation of complicated rules,\
        \ which is the status quo with traditional methods. DL has the potential to\
        \ transform DIA pipelines and bene\uFB01t a broad spectrum of large-scale\
        \ document digitization projects.\"},{\"type\":\"NarrativeText\",\"element_id\"\
        :\"c1f1ba1630bc19bd24c1dfbc1548f2d8\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":2},\"text\":\"However, there\
        \ are several practical di\uFB03culties for taking advantages of re- cent\
        \ advances in DL-based methods: 1) DL models are notoriously convoluted for\
        \ reuse and extension. Existing models are developed using distinct frame-\
        \ works like TensorFlow [1] or PyTorch [24], and the high-level parameters\
        \ can be obfuscated by implementation details [8]. It can be a time-consuming\
        \ and frustrating experience to debug, reproduce, and adapt existing models\
        \ for DIA, and many researchers who would bene\uFB01t the most from using\
        \ these methods lack the technical background to implement them from scratch.\
        \ 2) Document images contain diverse and disparate patterns across domains,\
        \ and customized training is often required to achieve a desirable detection\
        \ accuracy. Currently there is no full-\uFB02edged infrastructure for easily\
        \ curating the target document image datasets and \uFB01ne-tuning or re-training\
        \ the models. 3) DIA usually requires a sequence of models and other processing\
        \ to obtain the \uFB01nal outputs. Often research teams use DL models and\
        \ then perform further document analyses in separate processes, and these\
        \ pipelines are not documented in any central location (and often not documented\
        \ at all). This makes it di\uFB03cult for research teams to learn about how\
        \ full pipelines are implemented and leads them to invest signi\uFB01cant\
        \ resources in reinventing the DIA wheel.\"},{\"type\":\"NarrativeText\",\"\
        element_id\":\"836e6ef5cecc9a73356c0d5bee181829\",\"metadata\":{\"filename\"\
        :\"layout-parser-paper-fast.pdf\",\"filetype\":\"application/pdf\",\"page_number\"\
        :2},\"text\":\"LayoutParser provides a uni\uFB01ed toolkit to support DL-based\
        \ document image analysis and processing. To address the aforementioned challenges,\
        \ LayoutParser is built with the following components:\"},{\"type\":\"UncategorizedText\"\
        ,\"element_id\":\"71c0c5ffbb8105ccb9f3bd1543f59007\",\"metadata\":{\"filename\"\
        :\"layout-parser-paper-fast.pdf\",\"filetype\":\"application/pdf\",\"page_number\"\
        :2},\"text\":\"1. An o\uFB00-the-shelf toolkit for applying DL models for\
        \ layout detection, character\"},{\"type\":\"UncategorizedText\",\"element_id\"\
        :\"798b60ffa3907be6de6b739de4b6ae6b\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":2},\"text\":\"recognition,\
        \ and other DIA tasks (Section 3)\"},{\"type\":\"UncategorizedText\",\"element_id\"\
        :\"5e547c7cebdde2107f00c9d51402dbe6\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":2},\"text\":\"2. A rich\
        \ repository of pre-trained neural network models (Model Zoo) that\"},{\"\
        type\":\"UncategorizedText\",\"element_id\":\"a755646a34c86b2fb223ed3040821c4b\"\
        ,\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\",\"filetype\"\
        :\"application/pdf\",\"page_number\":2},\"text\":\"underlies the o\uFB00-the-shelf\
        \ usage\"},{\"type\":\"UncategorizedText\",\"element_id\":\"beba83994ae4b4055cfc52903455a858\"\
        ,\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\",\"filetype\"\
        :\"application/pdf\",\"page_number\":2},\"text\":\"3. Comprehensive tools\
        \ for e\uFB03cient document image data annotation and model\"},{\"type\":\"\
        UncategorizedText\",\"element_id\":\"3ecbd234f3fb48c8974ca103ce412060\",\"\
        metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\",\"filetype\":\"\
        application/pdf\",\"page_number\":2},\"text\":\"tuning to support di\uFB00\
        erent levels of customization\"},{\"type\":\"UncategorizedText\",\"element_id\"\
        :\"18b1855acfb386ae6e6a253da566e93b\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":2},\"text\":\"4. A DL model\
        \ hub and community platform for the easy sharing, distribu- tion, and discussion\
        \ of DIA models and pipelines, to promote reusability, reproducibility, and\
        \ extensibility (Section 4)\"},{\"type\":\"NarrativeText\",\"element_id\"\
        :\"1f0f5df7c23d4f8e8de4de3085abd7d8\",\"metadata\":{\"filename\":\"layout-parser-paper-fast.pdf\"\
        ,\"filetype\":\"application/pdf\",\"page_number\":2},\"text\":\"The library\
        \ implements simple and intuitive Python APIs without sacri\uFB01cing generalizability\
